import Nav from "./pages/Nav";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./pages/Nav.css"
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav />
        <Routes>
          <Route path="/" />
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
